import{_ as t}from"./chunks/v5__01.BTouU_wQ.js";import{_ as a}from"./chunks/debug_port_dsu7.Dgj2juP5.js";import{_ as r}from"./chunks/cuav_v5_debug_cable.CjGsjR_g.js";import{_ as o,c as i,a8 as l,o as s}from"./chunks/framework.BDnHobkS.js";const v=JSON.parse('{"title":"CUAV V5+ 자동조종장치","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/cuav_v5_plus.md","filePath":"ko/flight_controller/cuav_v5_plus.md"}'),d={name:"ko/flight_controller/cuav_v5_plus.md"};function n(c,e,h,p,u,m){return s(),i("div",null,e[0]||(e[0]=[l('<h1 id="cuav-v5-자동조종장치" tabindex="-1">CUAV V5+ 자동조종장치 <a class="header-anchor" href="#cuav-v5-자동조종장치" aria-label="Permalink to &quot;CUAV V5+ 자동조종장치&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><em>V5+</em><sup>®</sup> is an advanced autopilot manufactured by CUAV<sup>®</sup>. CUAV<sup>®</sup>와 PX4팀이 공동으로 설계하였습니다.</p><p>자동조종장치는 상용시스템 통합에 권장되지만, 학술 연구와 기타 용도에도 적합합니다.</p><p><img src="'+t+'" alt="V5+ AutoPilot - hero image"></p><p>주요 기능은 다음과 같습니다.</p><ul><li>Full compatibility with the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk project</a> <strong>FMUv5</strong> design standard and uses the <a href="https://pixhawk.org/pixhawk-connector-standard/" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> for all external interfaces.</li><li>더 안정적이고 신뢰할 수 있는 센서와 함께 FMU v3보다 고급 프로세서, RAM 및 플래시 메모리.</li><li>PX4와 펌웨어 호환.</li><li>모듈식 설계를 통해 사용자는 자신의 캐리어 보드를 설정할 수 있습니다.</li><li>고성능 충격흡수 시스템을 갖춘 내장형 진동감쇠 시스템.</li><li>비행 안전 향상을 위한 다중 센서와 전원 시스템.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="요약" tabindex="-1">요약 <a class="header-anchor" href="#요약" aria-label="Permalink to &quot;요약&quot;">​</a></h2><ul><li><p>메인 FMU 프로세서: STM32F765</p><ul><li>32 비트 Arm® Cortex®-M7, 216MHz, 2MB 메모리, 512KB RAM</li></ul></li><li><p>IO 프로세서: STM32F100</p><ul><li>32 비트 Arm® Cortex®-M3, 24MHz, 8KB SRAM</li></ul></li><li><p>내장 센서 :</p><ul><li>가속도계/자이로스코프 : ICM-20689</li><li>가속도계/자이로스코프 : BMI055</li><li>자력계 : IST8310</li><li>기압계: MS5611</li></ul></li><li><p>인터페이스:</p><ul><li>PWM 출력 8-14개(IO 6개, FMU 8개)</li><li>FMU의 전용 PWM/캡처 입력 3 개</li><li>CPPM 전용 RC 입력</li><li>아날로그/PWM RSSI 입력이있는 Spektrum/DSM 및 S.Bus 전용 RC 입력</li><li>아날로그/PWM RSSI 입력</li><li>PWM Servo 출력</li><li>범용 시리얼 포트 5개</li><li>I2C 포트 4개</li><li>SPI 버스 4개</li><li>2 CANBuses with serial ESC</li><li>배터리 2 개의 전압 및 전류에 대한 아날로그 입력</li></ul></li><li><p>전원시스템</p><ul><li>전원: 4.3~5.4V</li><li>USB 입력: 4.75~5.25V</li></ul></li><li><p>중량과 크기</p><ul><li>중량: 90g</li><li>Dimensions: 85.5*42*33mm</li></ul></li><li><p>기타 특성:</p><ul><li>작동 온도: -20 ~ 80°c (측정 값)</li></ul></li></ul><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p><a href="https://www.aliexpress.com/item/32890380056.html?spm=a2g0o.detail.1000060.1.7a7233e7mLTlVl&amp;gps-id=pcDetailBottomMoreThisSeller&amp;scm=1007.13339.90158.0&amp;scm_id=1007.13339.90158.0&amp;scm-url=1007.13339.90158.0&amp;pvid=d899bfab-a7ca-46e1-adf2-72ad1d649822" target="_blank" rel="noreferrer">CUAV Aliexpress</a> (International users)</p><p><a href="https://item.taobao.com/item.htm?spm=a1z10.5-c.w4002-21303114052.37.a28f697aeYzQx9&amp;id=594262853015" target="_blank" rel="noreferrer">CUAV Taobao</a> (China Mainland users)</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Autopilot may be purchased with included Neo GPS module</p></div><p><a id="connection"></a></p><h2 id="배선" tabindex="-1">배선 <a class="header-anchor" href="#배선" aria-label="Permalink to &quot;배선&quot;">​</a></h2><p><a href="./../assembly/quick_start_cuav_v5_plus.html">CUAV V5+ Wiring Quickstart</a></p><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><p>Download <strong>V5+</strong> pinouts from <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">here</a>.</p><h2 id="정격-전압" tabindex="-1">정격 전압 <a class="header-anchor" href="#정격-전압" aria-label="Permalink to &quot;정격 전압&quot;">​</a></h2><p><em>V5+ AutoPilot</em> supports redundant power supplies - up to three sources may be used: <code>Power1</code>, <code>Power2</code> and <code>USB</code>. 이러한 소스중 하나 이상에 전원을 공급하여야합니다. 그렇지 않으면, 비행 컨트롤러에 전원이 공급되지 않습니다.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>On FMUv5 based FMUs with PX4IO module (as is the case for the <em>V5+</em>), the Servo Power Rail is only monitored by the FMU. FMU에 의해 전원에 의해 공급받지도 않고, 공급되지도 않습니다. However, the pins marked <strong>+</strong> are all common, and a BEC may be connected to any of the servo pin sets to power the servo power rail.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>이러한 조건에서 전원은 아래의 순서대로 시스템에 전원을 공급하여야합니다.</p><ol><li><code>Power1</code> and <code>Power2</code> inputs (4.3V to 5.4V)</li><li><code>USB</code> input (4.75V to 5.25V)</li></ol><h2 id="과전류-보호" tabindex="-1">과전류 보호 <a class="header-anchor" href="#과전류-보호" aria-label="Permalink to &quot;과전류 보호&quot;">​</a></h2><p>The <em>V5+</em> has over current protection on the 5 Volt Peripheral and 5 Volt high power, which limits the current to 2.5A. The <em>V5+</em> has short circuit protection.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Up to 2.5 A can be delivered to the connectors listed as pin 1 (although these are only rated at 1 A).</p></div><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port (<code>DSU7</code>). 보드에는 I/O 디버그 인터페이스가 없습니다.</p><p><img src="'+a+'" alt="Debug port (DSU7)"></p><p>The debug port (<code>DSU7</code>) uses a <a href="https://www.digikey.com.au/product-detail/en/jst-sales-america-inc/BM06B-GHS-TBT-LF-SN-N/455-1582-1-ND/807850" target="_blank" rel="noreferrer">JST BM06B</a> connector and has the following pinout:</p><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>5V+</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>DEBUG TX(출력)</td><td>+3.3V</td></tr><tr><td>3 (흑)</td><td>DEBUG TX(입력)</td><td>+3.3V</td></tr><tr><td>4 (흑)</td><td>FMU_SWDIO</td><td>+3.3V</td></tr><tr><td>5 (흑)</td><td>FMU_SWCLK</td><td>+3.3V</td></tr><tr><td>6 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><p>The product package includes a convenient debug cable that can be connected to the <code>DSU7</code> port. This splits out an FTDI cable for connecting the <a href="./../debug/system_console.html">PX4 System Console</a> to a computer USB port, and SWD pins used for SWD/JTAG debugging. The provided debug cable does not connect to the SWD port <code>Vref</code> pin (1).</p><p><img src="'+r+'" alt="CUAV Debug cable"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The SWD Vref pin (1) uses 5V as Vref but the CPU is run at 3.3V!</p><p>일부 JTAG 어댑터 (SEGGER J-Link)는 Vref 전압을 사용하여 SWD 라인의 전압을 설정합니다. For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts from pin 4 of the connector marked <code>DSM</code>/<code>SBUS</code>/<code>RSSI</code> to provide <code>Vtref</code> to the JTAG (i.e. providing 3.3V and <em>NOT</em> 5V).</p><p>For more information see <a href="#using-jtag-for-hardware-debugging">Using JTAG for hardware debugging</a>.</p></div><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (흐름 제어)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (흐름 제어)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX는 SBUS_RC 커넥터의 RC 입력입니다.</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>디버그 콘솔</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>PX4IO</td></tr></tbody></table><p><a id="optional-hardware"></a></p><h2 id="주변-장치" tabindex="-1">주변 장치 <a class="header-anchor" href="#주변-장치" aria-label="Permalink to &quot;주변 장치&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">Digital Airspeed Sensor</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>일반 RC 서보 또는 Futaba S-Bus 서보로 제어 가능한 모든 멀티콥터/비행기/로버 또는 보트. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="참고" tabindex="-1">참고 <a class="header-anchor" href="#참고" aria-label="Permalink to &quot;참고&quot;">​</a></h2><h4 id="다른-유형의-전원모듈용-커넥터에-디지털-또는-아날로그-전원모듈을-연결하지-마십시오" tabindex="-1">다른 유형의 전원모듈용 커넥터에 디지털 또는 아날로그 전원모듈을 연결하지 마십시오. <a class="header-anchor" href="#다른-유형의-전원모듈용-커넥터에-디지털-또는-아날로그-전원모듈을-연결하지-마십시오" aria-label="Permalink to &quot;다른 유형의 전원모듈용 커넥터에 디지털 또는 아날로그 전원모듈을 연결하지 마십시오.&quot;">​</a></h4><p>아날로그 전원모듈을 디지털 전원모듈 커넥터에 연결하면 해당 버스의 모든 I2C 장치가 중지됩니다. 특히, 경합으로 인하여 GPS의 나침반이 중지되고, 장기적으로 FMU가 손상 될 수도 있습니다.</p><p>마찬가지로, 아날로그 커넥터에 연결된 디지털 전원모듈은 작동하지 않으며, 장기적으로 전원 모듈이 손상될 수 있습니다.</p><h2 id="호환성" tabindex="-1">호환성 <a class="header-anchor" href="#호환성" aria-label="Permalink to &quot;호환성&quot;">​</a></h2><p>CUAV는 몇 가지 차별화된 디자인을 채택하고, 아래에서 설명하는 일부 하드웨어와 호환되지 않습니다.</p><p><a id="compatibility_gps"></a></p><h4 id="다른-장치와-호환되지-않는-gps" tabindex="-1">다른 장치와 호환되지 않는 GPS <a class="header-anchor" href="#다른-장치와-호환되지-않는-gps" aria-label="Permalink to &quot;다른 장치와 호환되지 않는 GPS&quot;">​</a></h4><p>The <em>Neo v2.0 GPS</em> recommended for use with <em>CUAV V5+</em> and <em>CUAV V5 nano</em> is not fully compatible with other Pixhawk flight controllers (specifically, the buzzer part is not compatible and there may be issues with the safety switch).</p><p>The UAVCAN <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS receiver</a> can also be used, and is compatible with other flight controllers.</p><p><a id="compatibility_jtag"></a></p><h4 id="하드웨어-디버깅에-jtag-사용" tabindex="-1">하드웨어 디버깅에 JTAG 사용 <a class="header-anchor" href="#하드웨어-디버깅에-jtag-사용" aria-label="Permalink to &quot;하드웨어 디버깅에 JTAG 사용&quot;">​</a></h4><p><code>DSU7</code> FMU Debug Pin 1 is 5 volts - not the 3.3 volts of the CPU.</p><p>일부 JTAG는이 전압을 사용하여 타겟과 통신시 IO 레벨을 설정합니다.</p><p>For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts of DSM/SBUS/RSSI pin 4 as Pin 1 on the debug connector (<code>Vtref</code>).</p><h2 id="알려진-이슈들" tabindex="-1">알려진 이슈들 <a class="header-anchor" href="#알려진-이슈들" aria-label="Permalink to &quot;알려진 이슈들&quot;">​</a></h2><p>The issues below refer to the <em>batch number</em> in which they first appear. 배치번호는 V01 뒤의 4 자리 생산날짜이며 비행 컨트롤러 측면의 스티커에 표시되어 있습니다. 예를 들어, 일련 번호 Batch V011904((V01은 V5의 번호, 1904는 생산날짜, 즉 배치번호)입니다.</p><p><a id="pin1_unfused"></a></p><h4 id="sbus-dsm-rssi-인터페이스-pin1-언퓨즈" tabindex="-1">SBUS/DSM/RSSI 인터페이스 Pin1 언퓨즈 <a class="header-anchor" href="#sbus-dsm-rssi-인터페이스-pin1-언퓨즈" aria-label="Permalink to &quot;SBUS/DSM/RSSI 인터페이스 Pin1 언퓨즈&quot;">​</a></h4><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This is a safety issue.</p></div><p>SBUS/DSM/RSSI 인터페이스에 다른 장비(RC 수신기 제외)를 연결하지 마십시오. 장비가 손상될 수 있습니다.</p><ul><li><em>Found:</em> Batches V01190904xxxx</li><li><em>Fixed:</em> Batches later than V01190904xxxx</li></ul><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">CUAV V5+ Manual</a></li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5+.html" target="_blank" rel="noreferrer">CUAV V5+ docs</a></li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a></li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a></li><li><a href="https://github.com/cuav/hardware/tree/master/V5_Autopilot/V5%2B/V5%2BBASE" target="_blank" rel="noreferrer">Base board design reference</a></li><li><a href="./../assembly/quick_start_cuav_v5_plus.html">CUAV V5+ Wiring Quickstart</a></li><li><a href="./../frames_multicopter/dji_f450_cuav_5plus.html">Airframe build-log using CUAV v5+ on a DJI FlameWheel450</a></li></ul>',71)]))}const k=o(d,[["render",n]]);export{v as __pageData,k as default};
